import React from 'react';
import CombinedAuthForm from '../components/CombinedAuthForm';


const AuthPage = ({ user, setUser }) => {
  return (
    <div>
      <CombinedAuthForm setUser={setUser} />
    </div>
  );
};

export default AuthPage;
